import React from 'react';
import './App.css';
import Home from './components/Home';
import Map from './components/Map';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
      <React.Fragment>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/map" element={<Map />} />
        </Routes>
      </React.Fragment>
  );
}

export default App;
